  data: function data() {
    return {
      form: {
        name: '',
        lanmu: '',
        state: ''
      },
      msg: '',
      daiding: '',
      myConfig: {
        // 编辑器不自动被内容撑高
        autoHeightEnabled: false,
        // 初始容器高度
        initialFrameHeight: 240,
        // 初始容器宽度
        initialFrameWidth: '100%',
